import React from 'react'
import styled from 'styled-components';

function LoginForm(){
    return (
      <StyledMainDiv>
        <form onSubmit="">
          <strong>Login</strong>
          <div className="input-block">
            <label htmlFor="user_email">E-mail</label>
            <input name="user_email" id="user_email" required></input>
          </div>

          <div className="input-block">
            <label htmlFor="user_password">Senha</label>
            <input name="user_password" id="user_password" required></input>
          </div>
          <button type="submit">Entrar</button>
          <div className="otherOptions">
            <span>
              <p className="otherOptions">Esqueceu sua senha?</p>
            </span>
            <span>
              <p className="otherOptions">Cadastre-se</p>
            </span>
          </div>
        </form>
      </StyledMainDiv>
    );
}

const StyledMainDiv = styled.div`
    width: 320px;
    background: #ffffff;
    box-shadow: 0 0 14px 0 rgba(0, 0, 0, 0.02);
    border-radius: 2px;
    padding: 30px 20px;
    margin: 0 auto;
`;

const StyledOtherDiv = styled.div`
    margin-top: 20px;

    input {
        width: 100%;
        height: 32px;
        font-size: 14px;
        color: grey;
        border: 0;
        border-bottom: 1px solid #3d195b;
    }

    label {
        color: #00fe82;
        font-size: 14px;
        font-weight: bold;
        display: block;
    }
`;

export default LoginForm;
